import React, { Component } from "react";
import Players from "./players";
import { hello } from "./common/date-picker";

class Games extends Component {
  state = {
    date: {},
  };

  render() {
    return (
      <div>
        {hello()}
        <Players />
      </div>
    );
  }
}

export default Games;
